<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="utf-8">
    <title>JSDoc: Home</title>
    <meta name="viewport" content="width=device-width,initial-scale=1">

    <link type="text/css" rel="stylesheet" href="styles/base.min.css">
</head>

<body class="body">

    <div class="container">

        <nav class="sidenav">
            <h2><a href="index.html">Home</a></h2>
        </nav>

        <main id="main" class="main">
            <div id="content" class="content">
                <h1 class="page-title">Home</h1>
                



    


    <h3> </h3>










    









            </div>

            <div class="toc">
                <h2>Table of contents</h2>
                <div class="toc-nav"></div>
            </div>
        </main>

        <footer class="footer">
            Documentation generated by <a href="https://github.com/jsdoc/jsdoc">JSDoc 4.0.4</a> on Sat Sep 13 2025 16:05:04 GMT-0400 (Eastern Daylight Time)
        </footer>
    </div>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/highlight.js/11.8.0/highlight.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/highlightjs-line-numbers.js/2.8.0/highlightjs-line-numbers.min.js"></script>
    <script >
        document.addEventListener('DOMContentLoaded', (event) => {
            document.querySelectorAll('.prettyprint.linenums code').forEach((el) => {
                hljs.configure({
                    languages: ['javascript'],
                });
                hljs.highlightElement(el);
                hljs.lineNumbersBlock(el);
            });
            document.querySelectorAll('pre code').forEach((el) => {
                hljs.configure({
                    languages: ['javascript'],
                });
                hljs.highlightElement(el);
            });
        })
    </script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/tocbot/4.18.2/tocbot.min.js"></script>
    <script>
        tocbot.init({
        // Where to render the table of contents.
        tocSelector: '.toc-nav',
        // Where to grab the headings to build the table of contents.
        contentSelector: '.main article',
        // Which headings to grab inside of the contentSelector element.
        headingSelector: 'h1.name, h2.name, h3.name, h4.name',
        headingLabelCallback: (string) => string
    });
    </script>
</body>
</html>
